/** 
 * Picks up a  {@link RepositoryBrowser} that matches thegiven  {@link SCM} from existing other jobs.
 * @return null if no applicable configuration was found.
 */
private RepositoryBrowser infer(){
  for (  AbstractProject p : Jenkins.get().allItems(AbstractProject.class)) {
    SCM scm=p.getScm();
    if (scm != null && scm.getClass() == owner.getClass() && scm.getBrowser() != null && ((SCMDescriptor)scm.getDescriptor()).isBrowserReusable(scm,owner)) {
      return scm.getBrowser();
    }
